(63, '钢制邮箱', 'gangzhiyouxiang', 'jiatingjiaju', 0, 0, '', '钢制邮箱', '钢制邮箱', '', 1, '尺寸：H370*L370*W110mm/定制。\r\n颜色：白色/黑色/定制。\r\n简要特点：可调节（高度）/可转换/可扩展。\r\n产品规格：LAKSHYO 2024 新型邮箱，住宅户外壁挂式现代邮箱。', '<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>厚度：一般0.6mm，但也可以选择0.4-0.8mm。</span> \r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>材质：优质SPCC冷轧钢板。</span> \r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>表面：环氧涂层，环保静电粉末涂层。</span> \r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>锁：钥匙锁。</span> \r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>结构：拆装结构易于运输，降低运输成本 用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>邮箱是存放信件、报纸的设备，随着社会的不断发展，邮箱的材质和制作工艺要求越来越高，而钢制邮箱凭借防水、防腐、耐用的特点受到市场的欢迎。</span> \r\n</p>', '2024-07-03 15:30:12.382182', '2024-07-03 15:30:12.390446', 34),
(64, '工具储物柜', 'gjcwg', 'gongjucunchu', 0, 0, '', '工具储物柜', '工具储物柜', '', 1, '尺寸：H1800*W1000*500mm/定制。\r\n\r\n颜色：蓝色/定制。\r\n\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：文件柜、收纳柜、工具推车、重型工具柜收纳系统、钢制工作台。', '<p>\r\n	<span style=\"font-size:18px;\">厚度：常规0.6mm，但可选择0.4-0.8mm。</span><br />\r\n<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：定制锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>\r\n<br />', '2024-07-03 15:32:18.620342', '2024-07-03 15:32:18.626471', 39),
(65, '客厅柜', 'ketinggui', 'jiatingjiaju', 0, 0, '', '客厅柜', '客厅柜', '', 1, '尺寸：H1020*L800*W400mm/定制。\r\n颜色：白色/黑色/定制。\r\n简要特点：可调节（高度）/可调节（其他）/可转换。\r\n产品规格：LAKSHYO热销简约金属书柜，客厅家具，书房柜玻璃柜客厅柜。', '<p>\r\n	厚度：一般0.6mm，但也可以选择0.4-0.8mm。\r\n</p>\r\n<p>\r\n	材质：优质SPCC冷轧钢板。\r\n</p>\r\n<p>\r\n	表面环氧涂层，环保静电粉末涂层。\r\n</p>\r\n<p>\r\n	结构：拆装式结构，方便运输，降低运输成本。\r\n</p>\r\n<p>\r\n	用途：健身房/运动/高尔夫/超市/家庭/工厂等。\r\n</p>\r\n<p>\r\n	客厅柜深受人们的欢迎，它是一种采用冷轧钢板制作而成的家具，具有防火、防水、防潮、防虫蛀和防腐蚀的特点，非常耐用。\r\n</p>\r\n<p>\r\n	近年来钢制客厅储物柜风格多样化，其中现代风、奶油色家具风靡一时，外观简洁有质感。LAKSHYO钢制柜体，采用环保粉末喷涂，打开即可直接使用，家里有小朋友也可以放心使用。\r\n</p>', '2024-07-03 15:34:29.036765', '2024-07-03 15:34:43.209229', 34);
