(68, '简易鞋柜', 'xiegui', 'jiatingjiaju', 0, 0, '', '简易鞋柜', '简易鞋柜', '', 1, '尺寸：1033*400*152mm（3层）/1362*400*152mm（4层）/定制。\r\n颜色：白色/黑色/定制。\r\n简要特点：可调节（高度）/可调节（其他）/可折叠/可转换/可扩展。\r\n产品规格：LAKSHYO 批发3/4层耐用时尚钢制鞋架客厅金属鞋柜。', '厚度：一般0.6mm，但也可以选择0.4-0.8mm。<br />\r\n<p>\r\n	材质：优质SPCC冷轧钢板。\r\n</p>\r\n<p>\r\n	表面：环氧涂层，环保静电粉末涂层。\r\n</p>\r\n<p>\r\n	结构：拆装结构易于运输，降低运输成本 用途：健身房/运动/高尔夫/超市/家庭/工厂等。\r\n</p>\r\n<p>\r\n	多功能家用鞋柜，多层、抽屉式设计，提供充足的储物空间，方便鞋子的整理和收纳。其中，超薄钢制鞋柜，不仅可以满足收纳需求，还能大大节省空间。\r\n</p>', '2024-07-03 15:37:10.931913', '2024-07-03 15:37:10.938451', 34),
