(73, '四抽鞋柜', 'sichou', 'jiatingjiaju', 0, 0, '', '四抽鞋柜', '四抽鞋柜', '', 1, '尺寸：H1362*W800*D152mm/定制。\r\n颜色：白色/黑色/定制。\r\n简要特点：可调节（高度）/可转换/可扩展。\r\n产品规格：批发简约设计鞋架四抽屉金属鞋柜。', '<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>厚度：常规0.6mm，也可以选择0.4-0.8mm。</span>\r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>材质：优质SPCC冷轧钢板。</span>\r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>表面：环氧涂层，环保静电粉末涂层。</span>\r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>锁：磁力锁。</span>\r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>结构：拆装式结构，方便运输，降低运输成本。</span>\r\n</p>\r\n<p style=\"font-size:16px;color:#717479;font-family:&quot;\">\r\n	<span>用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>', '2024-07-03 15:43:30.536157', '2024-07-03 15:43:30.542294', 34),
(74, '智能快递储物柜', 'znkdcwg', 'zhinengjigui', 0, 0, '', '智能快递储物柜', '智能快递储物柜', '', 1, '型号： LAKSHYO02\r\n\r\n尺寸：H1800*W850*D460mm/定制。\r\n\r\n颜色：白色/黑色/定制。\r\n\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：智能包裹柜、智能金属储物柜、智能储物柜。', '<p>\r\n	<span style=\"font-size:18px;\">厚度：常规0.6mm，但可以选择0.4-1.2mm。</span><br />\r\n<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：智能锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>\r\n<br />', '2024-07-03 15:45:18.639926', '2024-07-03 15:45:18.651482', 38),
(75, '电子储物柜', 'dzcwg', 'zhinengjigui', 0, 0, '', '电子储物柜', '电子储物柜', '', 1, '型号： LAKSHYO01\r\n\r\n尺寸：H1800*W850*D46mm/定制\r\n\r\n颜色：白色/黑色/定制。\r\n\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：热销智能钢制储物柜、公共储物柜、电子储物柜、智能储物柜。', '<p>\r\n	<span style=\"font-size:18px;\">厚度：常规0.6mm，但可以选择0.4-1.2mm。</span><br />\r\n<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层、环保静电涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：智能锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>', '2024-07-03 15:48:40.615421', '2024-07-03 15:48:40.621428', 38),
(76, '工业储物架', 'gycwj', 'cunchujijia', 0, 0, '', '工业储物架', '工业储物架', '', 1, '简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：高品质重型工业货架、仓库货架、钢制存储货架、超市货架。', '<p>\r\n	<span style=\"font-size:18px;\">厚度：常规0.7mm，但可以选择0.4-1.2mm。</span><br />\r\n<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：推拉门锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>', '2024-07-03 15:57:46.892627', '2024-07-03 15:57:46.900714', 37),
(77, '厨房储物架', 'cfcwj', 'cunchujijia', 0, 0, '', '厨房储物架', '厨房储物架', '', 1, '尺寸：H2000*W600*D2000mm/定制。\r\n\r\n颜色：白色/黑色/定制。\r\n\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：高品质重型工业货架、仓库货架、钢制仓储货架、超市货架。', '<p>\r\n	<span style=\"font-size:18px;\">厚度：常规0.7mm，但可以选择0.4-1.2mm。</span><br />\r\n<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：推拉门锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：</span><span style=\"font-size:18px;\">健身房</span><span style=\"font-size:18px;\">/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>', '2024-07-03 16:00:04.709735', '2024-07-03 16:00:04.716049', 37),
(78, '防爆柜', 'fangbaogui', 'gongye', 0, 0, '', '防爆柜', '防爆柜', '', 1, '防爆设计：采用特殊的密封结构和材料，以阻止化学品与外部火源接触，减少风险。\r\n防火保护：能够抵御高温和火焰的侵袭。\r\n安全性能：备有专用报警装置和声光报警系统。', '<span style=\"color:#05073B;font-family:-apple-system, BlinkMacSystemFont, &quot;font-size:15px;background-color:#FDFDFE;\">防爆柜是专为存储易燃易爆物品设计的安全储存设备，具备出色的防火、防爆性能，能够保护存储物品及周围环境的安全。</span>', '2024-07-03 16:00:35.094995', '2024-07-03 16:00:35.100998', 35),
(79, '防火抽屉柜', 'choutifanghuo', 'gongye', 0, 0, '', '防火抽屉柜', '防火抽屉柜', '', 1, '防火性能好，有效保护存放的重要文件、资料或物品免受损害。\r\n抽屉式设计便于分类存储与快速取用，提升了工作效率与空间利用率。', '<span style=\"color:#05073B;font-family:-apple-system, BlinkMacSystemFont, &quot;font-size:15px;background-color:#FDFDFE;\">防火抽屉柜是用于存放重要文件、资料或物品，具备优异防火性能，能在火灾中保护内容安全的储物家具。</span>', '2024-07-03 16:02:33.446773', '2024-07-03 16:02:33.455443', 35),
(80, '四层储物架', '4ccwj', 'cunchujijia', 1, 0, '', '四层储物架', '四层储物架', '', 1, '尺寸：H2000*W600*D2000mm/定制。\r\n\r\n颜色：白色/黑色/定制。\r\n\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：现代拆卸设计，4层轻型金属柜，储物架，带护栏储物架。', '<p>\r\n	<span style=\"font-size:18px;\">厚度：常规0.7mm，但可以选择0.4-1.2mm。</span><br />\r\n<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：推拉门锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>', '2024-07-03 16:05:07.434605', '2024-07-03 16:05:07.442186', 37),
(81, '枪柜', 'qianggui', 'gongye', 0, 0, '', '枪柜', '枪柜', '', 1, '坚固耐用，多重防护。\r\n密封性结构，防潮防锈。\r\n多隔层设计，操作简单。', '<span style=\"color:#05073B;font-family:-apple-system, BlinkMacSystemFont, &quot;font-size:15px;background-color:#FDFDFE;\">枪柜具备安全、防潮防锈、分类管理、防尘防蛀防晒、智能化管理以及报警与监控等多重特点，<span style=\"color:#05073B;font-family:-apple-system, BlinkMacSystemFont, &quot;font-size:15px;background-color:#FDFDFE;\">具备多重安全防护和智能化管理功能。</span></span>', '2024-07-03 16:05:20.704854', '2024-07-03 16:05:20.712095', 35),
(82, '可调节课桌椅套装', 'kzytz', 'xuexiaojiaju', 0, 0, '', '可调节课桌椅套装', '可调节课桌椅套装', '', 1, '尺寸：定制。\r\n颜色：白色/黑色/定制。\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n产品规格：可调节小学课桌椅套装、高度可调的学前班课桌椅。', '<p>\r\n	<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板和木质。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：推拉门锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span>\r\n</p>', '2024-07-03 16:09:22.719980', '2024-07-03 16:09:22.725501', 36),
(83, '课桌椅套装', 'kzytz2', 'xuexiaojiaju', 0, 0, '', '课桌椅套装', '课桌椅套装', '', 1, '尺寸：定制。\r\n\r\n颜色：白色/黑色/定制。\r\n\r\n简要功能：可调节（高度）/可转换/可扩展。\r\n\r\n产品规格：热销学校家具桌椅、学校教室课桌椅套装、学生桌椅。', '<p>\r\n	<span style=\"font-size:18px;\">材质：优质SPCC冷轧钢板和木质。</span><br />\r\n<span style=\"font-size:18px;\">表面：环氧涂层，环保静电功率涂层。</span><br />\r\n<span style=\"font-size:18px;\">锁：推拉门锁。</span><br />\r\n<span style=\"font-size:18px;\">结构：拆卸式结构，运输方便，降低运输成本。</span><br />\r\n<span style=\"font-size:18px;\">用途：健身房/运动/高尔夫/超市/家庭/工厂等。</span> \r\n</p>', '2024-07-03 16:12:56.097154', '2024-07-03 16:12:56.105954', 36);
INSERT INTO `goods_goodscatalog` (`id`, `name`, `url`, `sort`, `image`, `title`, `keywords`, `describe`, `jianjie`, `is_sitemap`, `created_time`, `category_id`) VALUES
(31, '产品中心', 'products', 1, '', '莱科上阳钢制办公家具系列收藏', '钢铁办公家具系列，钢铁办公家具', '莱科商阳拥有完整的钢制办公家具系列，包括衣柜、文件柜、家居柜、智能柜和置物架系列等，满足您的不同需求，为用户提供产品定制服务。', '', 1, '2024-06-29 09:30:08.003988', NULL),
(32, '钢制更衣柜', 'jinshuyichu', 1, 'goods_c_images/goods_c_images/1-1_O6enIn0.webp', '满足各种存储需求的金属更衣柜系列', '钢制更衣柜，家居更衣柜', '我们的钢制更衣柜不仅耐用美观，而且具有出色的储物功能。多种风格可供选择，以满足您的个性化需求，使您的家更加整洁有序。', '我们的钢制更衣柜由冷轧钢板制成，确保防潮、防霉、防锈。它还具有防晒性，不含甲醛和气味，使用安全。柜内部分区整齐，储物非常方便，告别了季节性的翻箱倒柜，有各种时尚的图案可供选择，既实用又美观。联系我们了解更多信息！', 1, '2024-06-29 09:31:08.658794', 31),
(33, '办公家具', 'bangongjiaju', 2, 'goods_c_images/goods_c_images/1-2_gKhlPPx.webp', '优质办公家具选择：帮助您打造理想的办公空间', '办公家具，钢制办公家具', '为你的办公室选择优质的办公家具。我们的产品包括各种文件柜、储物柜、办公桌和储物柜等，帮助您创造理想的办公环境，提高工作效率。', '钢制家具设计时尚，适应性强，与各种室内美学无缝融合，无论是家庭办公室、企业工作场所还是商业环境。我们的钢制家具系列提供优雅与实用的和谐融合，满足现代生活的需求。探索我们的系列，以持久耐用和百搭精致提升您的空间', 1, '2024-06-29 09:32:10.538964', 31),
(34, '家用家具', 'jiatingjiaju', 3, 'goods_c_images/goods_c_images/1-4_9AOQvb9.webp', '高品质家居家具系列', '家用家具', '在家居收藏中，探索我们的优质家具，包括鞋柜、客厅储物柜、金属抽屉柜等，精心挑选的材料和精湛的工艺，为您带来相同的家居体验。立即购物，享受折扣！', '家居系列，主要是为了方便人们使用，可以分类存放不同的物品。对于空间较小的家庭或宿舍来说，它是必须的，可以充分利用空间容纳更多的日常用品，并可以很好地装饰人们的家居环境。LAKSHYO钢制储物柜有多种尺寸、样式、材料和配置，可用于需要组织和储存的各种环境。', 1, '2024-06-29 09:33:17.130949', 31),
(35, '工业安全系列', 'gongye', 4, 'goods_c_images/goods_c_images/1-4_sUQoZqf.webp', '工业安全柜系列|设备保护解决方案', '防爆柜', '工业安全柜包括枪柜、防火文件柜和防爆柜等，集成多种安全功能，为您的设备和文件提供全面保护。', '钢制工业安全柜是一种储存各种危险化学品的设备，包括：防爆柜、防火文件柜、枪柜等。这些柜可以有效地对危险物品进行分类和储存，并降低火灾发生时爆炸迅速蔓延的风险，为现场工作人员提供一定的逃生时间，降低危害程度。', 1, '2024-06-29 09:34:24.730798', 31),
(36, '学校家具', 'xuexiaojiaju', 5, 'goods_c_images/goods_c_images/1-5_yjkDPHS.webp', '舒适耐用的校服-适合所有年龄段的学生', '学校家具', '优质的学校家具使学生能够在舒适的环境中学习。我们的产品经过严格测试，以确保耐用性，适合所有年龄段的学生，帮助他们提高学习效率。', '椅子和桌子\r\n产品包括学生高度可调节的桌椅、固定桌椅、学校桌子、儿童家具、绘图台、讲台、成排椅子、食堂桌子和宿舍床。\r\n带桌子的椅子\r\n1.简单的教室书桌，爱上互动的学习生活。\r\n2.稳定性强，承载能力高，不占用空间，简单实用。\r\n3.易清洗、防水防潮、耐刮、耐划伤、耐热。\r\n4.紧密耐用的边缘密封工艺，使密封件的边缘与桌子的边缘非常紧密，不易脱落，美观防刮。', 1, '2024-06-29 09:35:27.602978', 31),
(37, '储物架', 'cunchujijia', 6, 'goods_c_images/goods_c_images/1-7_s8TWSmU.webp', '高质量存储机架：最大限度利用空间的解决方案', '货架', '莱克的高品质储物架有多种规格和款式可供选择，以满足不同的储物需求。无论是工业、办公还是家庭，我们都有合适的存储解决方案。', '我们生产、研发、成型设计和销售各种类型的高品质堆垛架和货架、轻型货架、中型货架、重型货架、超市货架、夹层地板、免下车货架等。', 1, '2024-06-29 09:37:01.114958', 31),
(38, '智能柜', 'zhinengjigui', 7, 'goods_c_images/goods_c_images/1-6_qVQRuaF.webp', '智能柜：高效、智能、安全的存储解决方案', '智能柜', '智能柜结合先进技术，提供高效便捷的存储解决方案。无论是快递收纳、物品收纳等，智能柜都能满足您的需求，提升您的收纳体验。', '智能柜融合了云计算和物联网两大前沿技术，实现了物品访问与后台数据分析处理的完美结合。通过智能手机终端和服务器，智能柜系统可以高效运行。智能柜通过智能锁和密码系统，让您可以轻松存储和取出自己的物品，无需携带和管理钥匙，智能柜以其独特的功能特点和便利性，为我们提供前所未有的存储体验。', 1, '2024-06-29 09:38:07.147276', 31),
(39, '工具柜', 'gongjucunchu', 8, 'goods_c_images/goods_c_images/1-7_gU1zZS0.webp', '工具柜', '工具柜', '我们的工具收纳柜系列包括工具柜、车间工具柜等，适用于各种环境，帮助您保持工具整洁有序，提高工作效率。', '钢制工具柜是为工厂等生产场所设计的存储设备，具有高强度结构设计和耐用性。它采用专用导轨，承重重，满载也能顺利进出；工具柜的抽屉可以选择分拣箱和隔板，便于分类管理，有效利用空间。\r\n此外，钢制工具柜还具有良好的防尘、防鼠、防潮和防火功能，确保其在使用过程中的安全可靠。它们不仅适用于工厂的现场管理，也适用于其他需要高效安全存储的场所。', 1, '2024-06-29 09:39:43.754741', 31),
(40, '钢制床', 'jinshuchaung', 9, 'goods_c_images/goods_c_images/1-9_6O5Y40O.webp', '高品质铁床系列-现代设计，舒适', '钢制床', '我们的高品质铁床系列将现代设计与非凡舒适相结合。无论是单人折叠床、双层床还是钢制折叠床，我们都能满足您的需求，请联系我们定制。', '我们的钢制床由粗厚钢材制成，承重强，优质油漆钢架，采用优质油漆，耐高温试验工艺，不褪色，无异味，优质字母螺丝，床牢固不摇晃，几次拆装耐用，安装简单，美观，睡眠放心，可定制颜色和尺寸。', 1, '2024-06-29 09:40:52.137493', 31),
(41, '不锈钢柜', 'buxiugangjigui', 10, 'goods_c_images/goods_c_images/1-10_j7X8jq0.webp', '定制不锈钢储物柜，满足多样化的存储需求', '不锈钢储物柜', '无论您需要储物柜、药柜还是定制存储解决方案，我们都能满足您的需求，为您提供一站式服务。', '由优质不锈钢制成，经得起时间的考验，以确保持久的耐用性和可靠性，具有可调节的货架和可定制的配置，我们可为任何环境提供了多功能的存储解决方案，从厨房到车库再到商业空间，防锈、防腐和防污，不锈钢柜易于清洁和维护，同时配备了安全的锁紧机构，用于安全存储。', 1, '2024-06-29 09:41:54.211632', 31);
