INSERT INTO `page_job` (`id`, `name`, `address`, `number`, `describe`, `rzyq`, `created_time`, `updated_time`) VALUES
(1, 'Android财务管理类', '洛阳', 2, '1、负责日常收支的管理和核对；\r\n2、办公室基本账务的核对；\r\n3、负责收集和审核原始凭证，保证报销手续及原始单据的合法性、准确性；\r\n4、负责登记现金、银行存款日记账并准确录入系统，按时编制银行存款余额调节表；\r\n5、负责记账凭证的编号、装订；保存、归档财务相关资料；\r\n6、负责开具各项票据。', '1、大学本科及以上学历，会计学或财务管理专业毕业；\r\n2、具有1年以上出纳工作经验,生产型企业工作经验者优先；\r\n3、熟悉操作财务软件、Excel、Word等办公软件；\r\n4、记账要求字迹清晰、准确、及时，账目日清月结，报表编制准确、及时；\r\n5、踏实、守信；\r\n6、了解国家财经政策和会计、税务法规，熟悉银行结算业务。', '2023-04-11 17:27:33.794883', '2023-04-11 17:27:33.799633'),
(2, 'Android财务管理类', '洛阳', 2, '1、负责日常收支的管理和核对；\r\n2、办公室基本账务的核对；\r\n3、负责收集和审核原始凭证，保证报销手续及原始单据的合法性、准确性；\r\n4、负责登记现金、银行存款日记账并准确录入系统，按时编制银行存款余额调节表；\r\n5、负责记账凭证的编号、装订；保存、归档财务相关资料；\r\n6、负责开具各项票据。', '1、大学本科及以上学历，会计学或财务管理专业毕业；\r\n2、具有1年以上出纳工作经验,生产型企业工作经验者优先；\r\n3、熟悉操作财务软件、Excel、Word等办公软件；\r\n4、记账要求字迹清晰、准确、及时，账目日清月结，报表编制准确、及时；\r\n5、踏实、守信；\r\n6、了解国家财经政策和会计、税务法规，熟悉银行结算业务。', '2023-04-11 17:28:44.730220', '2023-04-11 17:28:44.734603'),
(3, 'Android财务管理类', '洛阳', 2, '1、负责日常收支的管理和核对；\r\n2、办公室基本账务的核对；\r\n3、负责收集和审核原始凭证，保证报销手续及原始单据的合法性、准确性；\r\n4、负责登记现金、银行存款日记账并准确录入系统，按时编制银行存款余额调节表；\r\n5、负责记账凭证的编号、装订；保存、归档财务相关资料；\r\n6、负责开具各项票据。', '1、大学本科及以上学历，会计学或财务管理专业毕业；\r\n2、具有1年以上出纳工作经验,生产型企业工作经验者优先；\r\n3、熟悉操作财务软件、Excel、Word等办公软件；\r\n4、记账要求字迹清晰、准确、及时，账目日清月结，报表编制准确、及时；\r\n5、踏实、守信；\r\n6、了解国家财经政策和会计、税务法规，熟悉银行结算业务。', '2023-04-11 17:29:57.148224', '2023-04-11 17:29:57.153123');
