INSERT INTO `page_page` (`id`, `name`, `url`, `is_bar`, `sort`, `is_sitemap`, `title`, `keywords`, `describe`, `content`, `created_time`, `updated_time`) VALUES
(12, '公司简介', 'about', 1, 1, 0, '公司简介', '公司简介', '作为一家专业的钢制办公家具公司，莱克上阳的产品涵盖了所有系列的办公家具，出口到世界各地，受到了客户的好评。', '&emsp;&emsp;洛阳市莱客上阳进出口贸易有限公司位于中国河南省洛阳市。本公司是集设计，生产，销售于一体的办公家具系列产品生产厂家。<br />\r\n&emsp;&emsp;<br />\r\n&emsp;&emsp;本公司产品以现代简约风为主，涵盖：各种拆装文件柜系列、更衣柜系列、卡箱柜系列、置物架系列，床等钢制办公家具。我们拥有先进的设备和严格的质量管控，经过多年的奋斗，赢得了国内外客户的好评。<br />', '2023-11-27 10:45:17.408705', '2024-07-03 16:15:35.392852'),
(13, '联系我们', 'contact', 1, 2, 0, '联系我们', '联系我们', '联系我们', '', '2023-11-27 10:46:19.504219', '2023-11-27 10:46:19.507211'),
(14, '定制服务', 'service', 1, 3, 0, '钢制办公家具定制服务', '钢制办公家具定制服务', '我们为行业用户提供定制的钢制办公家具服务。我们通过严格的生产流程和质量检测技术确保产品质量。我们还提供24小时在线服务，解决您的后顾之忧。', '', '2024-06-29 09:47:59.456340', '2024-06-29 09:47:59.459333');
